def isValid(s):
    open = ['(','[','{']
    close = [')',']','}']

    stack = []

    for character in s:
        if character in open:
            stack.append(character)
        else:
            for index,i in enumerate(close):
                if character == i:
                    position = index
                    break

            if open[position] not in stack:
                return False

            if open[position] in stack[len(stack)-1]:
                stack.pop()
            
        print(stack)
            
    if stack == []:
        return True
    else:
        return False

